def find_kth_character(k):
    n = 0
    while (n * (n + 1)) // 2 < k:
        n += 1

    if (n * (n + 1)) // 2 == k:
        return chr(ord('a') + (k - 1) % 26)

    remainder = k - ((n * (n - 1)) // 2)
    return chr(ord('a') + remainder - 1)

