def countWinners(n, pick):
    # Dictionary to store the count of balls picked by each player for each color
    player_picks = {i: {} for i in range(n)}

    # Count the number of balls picked by each player for each color
    for player, color in pick:
        if color not in player_picks[player]:
            player_picks[player][color] = 0
        player_picks[player][color] += 1

    # Initialize the count of winners
    winners = 0

    # Check each player's picks
    for player in range(n):
        for color, count in player_picks[player].items():
            if count >= player + 1:
                winners += 1
                break  # No need to check further colors once one condition is met

    return winners

