    n = len(s)
    count = 0

    for i in range(n):
        zero_count = 0
        one_count = 0
        for j in range(i, n):
            if s[j] == '0':
                zero_count += 1
            else:
                one_count += 1
            if zero_count <= k or one_count <= k:
                count += 1

    return count

